import React from 'react';
import IndexHeader from '../components/Headers/IndexHeader';// Import IndexHeader component
import LandingPageHeader from '../components/Headers/LandingPageHeader';
import ProfilePageHeader from '../components/Headers/ProfilePageHeader';
import DarkFooter from '../components/Footers/DarkFooter';
class HomePage extends React.Component {
  handleButtonClick = (buttonNumber) => {
    alert("Button " + buttonNumber + " clicked!");
  }

  render() {
    return (
      <div>
        <IndexHeader />
        <LandingPageHeader/>
        <ProfilePageHeader/> {/* Render IndexHeader component */}
        <div className="container mt-5">
          <h1 className="text-center">Welcome Home</h1>
          <div className="row justify-content-center">
            <div className="col-md-6">
              <div className="d-grid gap-2 justify-content-center">
                <button className="btn btn-primary" onClick={() => this.handleButtonClick(1)}>Button 1</button>
                <button className="btn btn-secondary" onClick={() => this.handleButtonClick(2)}>Button 2</button>
                <button className="btn btn-success" onClick={() => this.handleButtonClick(3)}>Button 3</button>
              </div>
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default HomePage;
